import React, { Component } from 'react';
import axios from 'axios';

class RestDemo extends Component {
    constructor(props){
        super(props);
        this.state={users:[]}
    }

    getAll=()=>{
      axios.get('https://jsonplaceholder.typicode.com/users').then(res=> console.log(res.data)).error(err => console.log(err));
      axios.get('https://jsonplaceholder.typicode.com/users').then(res=> this.setState({users:res.data})).error(err => console.log(err));
    };


    render() {
        var users= this.state.users.map((item,index)=>{
           return <h3 key={index}> {item.name}</h3>
        });

        return (
            <div className={''}>
                <input type="button" value="get users" onClick={this.getAll}/>
                {users}
            </div>
        );
    }
}

export default RestDemo;
